import React from 'react';
import styled from "styled-components";
import { Inputs, Form, InlineForm, InputSeparator, Button, DefaultInput, DefaultTextArea } from "../form/inputs";


const CustomDefaultTextArea = styled(DefaultTextArea)`
width: 700px;
height: 200px;
`;

const ContactUsForm = () => {
    return (
        <>
            <Form>
                <InlineForm>
                    <DefaultInput
                        placeholder="Full name..."
                        id="fullname"
                    />

                    <DefaultInput placeholder="Email address..." id="emailaddress" />

                </InlineForm>
                <DefaultInput
                    placeholder="Subject"
                    id="subject"
                />

                <CustomDefaultTextArea
                    placeholder="Message"
                    id="message"
                />



                <Button>Send Message</Button>
            </Form>
        </>
    );
}

export default ContactUsForm;
